@font-face {
  font-family: 'Bellota Text';
  font-style: normal;
  font-weight: 700;
  font-display: swap;
  src: url(https://fonts.gstatic.com/s/bellotatext/v16/0FlMVP2VnlWS4f3-UE9hHXM5RfwadA_xcy4.woff2) format('woff2');
  unicode-range: U+0100-02AF, U+1E00-1EFF, U+2020, U+20A0-20AB, U+20AD-20CF, U+2113, U+2C60-2C7F, U+A720-A7FF;
}
/* latin */
@font-face {
  font-family: 'Bellota Text';
  font-style: normal;
  font-weight: 700;
  font-display: swap;
  src: url(https://fonts.gstatic.com/s/bellotatext/v16/0FlMVP2VnlWS4f3-UE9hHXM5Rfwaeg_x.woff2) format('woff2');
  unicode-range: U+0000-00FF, U+0131, U+0152-0153, U+02BB-02BC, U+02C6, U+02DA, U+02DC, U+2000-206F, U+2074, U+20AC, U+2122, U+2191, U+2193, U+2212, U+2215, U+FEFF, U+FFFD;
}
div.content{
  background-image: none;
  background: whitesmoke;
  border: none;
}
.ppage p{
  background-image:none;
  opacity: 1;
  transition:500ms;
  padding-left:15px;
  padding-right:15px;
  font-family: 'Bellota Text';
	font-style: normal;
	font-weight: 700;
  border-width: 5px 0px 1px 0px;
  border-style: solid ;
  border-color:#000000;
}
.ppage p:hover {
  background:black;
  color:white;
}
.menu_horizontal .menu_horizontal_current {
  background-image: none;
}
.menu_horizontal a.menu_horizontal_left, .menu_horizontal a.menu_horizontal_left:hover, .menu_horizontal a.menu_horizontal_left:visited
{

	background-image: none;
}

.menu_horizontal a
{
  transition: 500ms;
  background-image: none;
  background:none;
}
.menu_horizontal a:hover
{
  border-width: 0px 10px 0px 10px;
	border-style: solid;
	border-color: #000000;
  background:none;
  background-image: none;
}

img {
  background-image:none;
}
body {
  background-color: whitesmoke;
}
pscreenshot {
  border-radius:25px;
  background: #9C9C9C;
	border-radius: 0px 0px 25px 25px;
}
pscreenshot::after {
  content: ".";
}
.content {
  opacity: 1;
  background-image:none;
}
.menu_horizontal_left {
   opacity:0;
}
.menu_horizontal a.menu_horizontal_current
{
	color: whitesmoke; 
  text-decoration: none;
	background-color: #aaaaaa;
	background-image: none;
  background-repeat: repeat-x; 
  background-position: center center;
}
.menu_horizontal:hover a.menu_horizontal_current:hover 
{
  
}
.menu_vertical a {
  transition: 500ms;
  background-image: none;
  width: 80%;
}
.tftextinput2 {
  transition:500ms;
  font-family: 'Bellota Text';
  border: 5px;
  width: 84%;
}
.tftextinput2:hover {
  color: white;
  padding-left: 1%;
  background-color: black;
}
.tfbutton2 {
  transition:500ms;
  border-radius: 0px 0px 0px 0px;
  width: 85%;
}
.tfbutton2:hover {
  color: white
}
.menu_vertical .menu_vertical_header {
  background:none;
  transition:500ms;
}
.menu_vertical:hover .menu_vertical_header:hover {
  transition:500ms;
  background-color: black;
  color:white;
  transition:500ms;
}

.content p {
  background-image:none;
  opacity: 1;
  transition:500ms;
  padding-left:15px;
  padding-right:15px;
  font-family: 'Bellota Text';
	font-style: normal;
	font-weight: 700;
  border-width: 5px 0px 1px 0px;
  border-style: solid ;
  border-color:#000000;
}
.content a:link {
  color: green;
}
.content p:link {
  color: green;
}
.content p:hover {
  background:black;
  color:white;
}
